using Cosmos.System.Graphics;
using System;

namespace Aura_OS.System
{
    public class Logo
    {
        /// <summary>
        /// Display Textual Logo of Aura
        /// </summary>
        public static void PrintText()
        {
            Console.ForegroundColor = ConsoleColor.White;
            Console.WriteLine($@"
  █████╗ ██╗   ██╗██████╗  █████╗
 ██╔══██╗██║   ██║██╔══██╗██╔══██╗
 ███████║██║   ██║██████╔╝███████║
 ██╔══██║██║   ██║██╔══██╗██╔══██║ 
 ██║  ██║╚██████╔╝██║  ██║██║  ██║ Aura Operating System
 ╚═╝  ╚═╝ ╚═════╝ ╚═╝  ╚═╝╚═╝  ╚═╝ v{ Global.version }
");
        }

        /// <summary>
        /// Display Logo of Aura
        /// </summary>
        public static void Print()
        {
            Console.Clear();

            Console.ForegroundColor = ConsoleColor.White;
            Console.WriteLine($@"
  
 
 
  
              Aura Operating System
              v{ Global.version }
");
            Bitmap bitmap = new Bitmap(Convert.FromBase64String(b64AuraLogo));
            Global.AConsole.DrawImage(17, 6, bitmap);
        }

        public static string b64AuraLogo = "";
        public static string b64CosmosLogo = "";
    }
}
